function getFloat(data, offset)
{
    var level = (data[offset] << 8 | data[offset + 1]);
    return level / 65535;
}

function getBytes(data)
{
    return data * 65535;
}

function getParaInt(paraName)
{
    return parseInt(device.getParameterByName(paraName).value, 10);
}

function getParaFloat(paraName)
{
    return parseFloat(device.getParameterByName(paraName).value.replace(",", "."));
}

function getParaBool(paraName)
{
    return device.getParameterByName(paraName).value == "1";
}

function arcToPercent(arc)
{
    if(arc == 0) return 0;
    return Math.pow(10, ((arc-1)/(253/3))-1);
}function buttonread(device, online, progress, context)
{
// Start read devicetype
progress.setText(device.getMessage(2));

var data = [2, context.Channel];
online.connect();
var resp = online.invokeFunctionProperty(160, 1, data); //invoke readdevicetype

if (resp[0] != 0) {
    // Dali Error:
    throw new Error(device.getMessage(1) + String(resp[0]));
}

var para = device.getParameterByName("deviceType");
if(resp[1] == 255)
{
    para.value = 0;
    throw new Error(device.getMessage(14)) // Unknown DeviceType
}

para.value = (resp[1]+1).toString();

if(resp[1] == 6 || resp[1] == 8)
{
    var byte = resp[2];

    para = device.getParameterByName("colorSpace");
    para.value = (byte & 1) ? "1" : "0";


    para = device.getParameterByName("colorType");
    para.value = (byte & 2) ? "2" : "1";
}

// Read Successfully devicetype
progress.setText(device.getMessage(3));
}
function buttonsettingsRead(device, online, progress, context)
{
progress.setText(device.getMessage(10)); // Start readeing Data from EVG
online.connect();
var data = online.invokeFunctionProperty(160, 1, [11, context.Channel]);
progress.setProgress(10);
if(data[0] != 0)
    throw new Error("Dali Error: " + data[0]);
var errors = "";

if(data[9] & 1) errors += "Min Level, ";
else {
    device.getParameterByName("min").value = arcToPercent(data[1]).toFixed(2).replace(".", ",");
} 
if(data[9] & 2) errors += "Max Level, ";
else {
    device.getParameterByName("max").value = arcToPercent(data[2]).toFixed(2).replace(".", ",");
}
if(data[9] & 4) errors += "Power On, ";
else {
    device.getParameterByName("poweron").value = data[3] == 255;
    if (data[3] != 255)
        device.getParameterByName("poweronlevel").value = arcToPercent(data[3]).toFixed(2).replace(".", ",");
}
if(data[9] & 8) errors += "Failure On, ";
else {
    device.getParameterByName("failureon").value = data[4] == 255;
    if (data[4] != 255)
        device.getParameterByName("failureonlevel").value = arcToPercent(data[4]).toFixed(2).replace(".", ",");
}
if(data[9] & 16) errors += "FadeTime/Rate, ";
else {
    device.getParameterByName("fadeTime").value = (data[5] >> 4).toString();
    device.getParameterByName("fadeRate").value = (data[5] & 15).toString();
}
//1 byte free
if(data[9] & 64) errors += "Groups 0-7, ";
else {
    device.getParameterByName("g0").value = (data[7] & 1);
    device.getParameterByName("g1").value = (data[7] & 2);
    device.getParameterByName("g2").value = (data[7] & 4);
    device.getParameterByName("g3").value = (data[7] & 8);
    device.getParameterByName("g4").value = (data[7] & 16);
    device.getParameterByName("g5").value = (data[7] & 32);
    device.getParameterByName("g6").value = (data[7] & 64);
    device.getParameterByName("g7").value = (data[7] & 128);
}
if(data[9] & 128) errors += "Groups 8-15, ";
else {
    device.getParameterByName("g8").value = (data[8] & 1);
    device.getParameterByName("g9").value = (data[8] & 2);
    device.getParameterByName("g10").value = (data[8] & 4);
    device.getParameterByName("g11").value = (data[8] & 8);
    device.getParameterByName("g12").value = (data[8] & 16);
    device.getParameterByName("g13").value = (data[8] & 32);
    device.getParameterByName("g14").value = (data[8] & 64);
    device.getParameterByName("g15").value = (data[8] & 128);
}

progress.setProgress(20);

data = [
        13,
        context.Channel,
        0, //scene number
        parseInt(device.getParameterByName("deviceType").value)-1,
        parseInt(device.getParameterByName("colorType").value)
    ];

for(var i = 0; i < 16; i++)
{
    progress.setText(device.getMessage(11) + i.toString()); // Parsing data
    data[2] = i;

    resp = online.invokeFunctionProperty(160, 1, data);

    device.getParameterByName("s" + i + "t").value = resp[0] != 255;

    if(resp[0] != 255)
    {
        device.getParameterByName("s" + i + "v").value = arcToPercent(resp[0]).toFixed(2).replace(".", ",")
        //deviceType is Color
        if(data[3] == 8)
        {
            //colorType is TunableWhite
            if(data[4] == 2)
            {
                var kelvin = (resp[1] << 8) | resp[2];
                device.getParameterByName("s" + i + "ct").value = kelvin;
                // var kelvin = parseInt(device.getParameterByName("s" + i + "ct").value);
                // data[7] = kelvin >> 8;
                // data[8] = kelvin & 256;
            } else { //it is RGB
                var color = (resp[1] << 16) | color;
                color = (resp[2] << 8) | color;
                color = resp[3];
                device.getParameterByName("s" + i + "cc").value = color.toString();
            }
        }
    }

    progress.setProgress(i*5 + 25);
}

if(errors != "")
    progress.setText(device.getMessage(13) + errors); // following couldnt be read
else
    progress.setText(device.getMessage(12)); // reading successfull
}
function buttonsettingsWrite(device, online, progress, context)
{
if(getParaInt("fadeTime") != "0" && getParaInt("fadeTimeExtendedMultiplier") != "0")
    throw new Error(device.getMessage(18)); // error 

progress.setText(device.getMessage(15)); // start

var data = [];
data.push(10);
data.push(context.Channel);
var temp = getBytes(getParaFloat("min"));
data.push(temp >> 8);
data.push(temp & 255);
temp = getBytes(getParaFloat("max"));
data.push(temp >> 8);
data.push(temp & 255);
if(getParaBool("poweron"))
{
    temp = getBytes(getParaFloat("poweronlevel"));
    data.push(temp >> 8);
    data.push(temp & 255);
} else {
    data.push(255);
    data.push(0);
}
if(getParaBool("failureon"))
{
    temp = getBytes(getParaFloat("failureonlevel"));
    data.push(temp >> 8);
    data.push(temp & 255);
} else {
    data.push(255);
    data.push(0);
}

var fade = getParaInt("fadeTime");
fade = fade << 4;
fade |= getParaInt("fadeRate");
data.push(fade);
data.push(0);//1byte free
var groups = getParaInt("g0");
groups |= getParaInt("g1") << 1;
groups |= getParaInt("g2") << 2;
groups |= getParaInt("g3") << 3;
groups |= getParaInt("g4") << 4;
groups |= getParaInt("g5") << 5;
groups |= getParaInt("g6") << 6;
groups |= getParaInt("g7") << 7;
data.push(groups);
groups = getParaInt("g8");
groups |= getParaInt("g9") << 1;
groups |= getParaInt("g10") << 2;
groups |= getParaInt("g11") << 3;
groups |= getParaInt("g12") << 4;
groups |= getParaInt("g13") << 5;
groups |= getParaInt("g14") << 6;
groups |= getParaInt("g15") << 7;
data.push(groups);

progress.setText(device.getMessage(16)); // transmit
online.connect();
var resp = online.invokeFunctionProperty(160, 1, data);
progress.setProgress(20);

data = [
        12,
        context.Channel, // + 128; only for group!
        0, //scene number
        0, //enabled
        getParaInt("deviceType")-1,
        getParaInt("colorType"),
        0, 0, 0, 0 //will be filled later
    ];

for(var i = 0; i < 16; i++)
{
    data[2] = i;
    var isEnabled = getParaBool("s" + i + "t");
    data[3] = isEnabled;
    data[6] = isEnabled ? getParaInt("s" + i + "v") : 255;

    //deviceType is Color
    if(isEnabled && data[4] == 8)
    {
        //colorType is TunableWhite
        if(data[5] == 2)
        {
            var kelvin = getParaInt("s" + i + "ct");
            data[7] = kelvin >> 8;
            data[8] = kelvin & 256;
        } else { //it is RGB
            var etsval = device.getParameterByName("s" + i + "cc").value;
            if(etsval < 0)
                etsval = etsval + 4294967296;
            data[7] = (etsval >> 16) & 255;
            data[8] = (etsval >> 8) & 255;
            data[9] = etsval & 255;
        }
    }

    resp = online.invokeFunctionProperty(160, 1, data);
    progress.setProgress(i*5 + 25);
}

online.disconnect();
progress.setText(device.getMessage(17)); // fin
}
function buttonassingAddr(device, online, progress, context)
{
var along = device.getParameterByName("longAddr");
var ashort = device.getParameterByName("shortAddr");

//assign address to device
progress.setText(device.getMessage(5));

var bytes = [4, parseInt(ashort.value)];
for (var c = 0; c < along.value.length; c += 2)
    bytes.push(parseInt(along.value.substr(c, 2), 16));

online.connect();

online.invokeFunctionProperty(160, 1, bytes);

bytes = [];
while(true)
{
    if(progress.isCanceled())
    {
        online.readFunctionProperty(160, 1, [4, 255]);
        return;
    }

    var resp = online.readFunctionProperty(160, 1, [4]);

    switch(resp[0])
    {
        case 2:
            //address set successfully
            progress.setText(device.getMessage(7));
            return;

        case 10:
            //dali error
            progress.setText(device.getMessage(1));
            return;

        case 11:
            //address is already in use
            throw new Error(device.getMessage(6));

        case 12:
            //long address dont exists
            throw new Error(device.getMessage(8));

        case 13:
            //short address confirm failed
            throw new Error(device.getMessage(9));

        case 14:
            //device wont answer
            throw new Error(device.getMessage(4));

    }
}
}
function buttonscan(device, online, progress, context)
{
online.connect();

var data = [3];
var para2 = device.getParameterByName("onlyUnaddressed");
data.push(parseInt(para2.value));
para2 = device.getParameterByName("dontRandomize");
data.push(parseInt(para2.value));
para2 = device.getParameterByName("deleteAll");
data.push(parseInt(para2.value));
para2 = device.getParameterByName("assignNew");
data.push(parseInt(para2.value));

//start addressing
online.invokeFunctionProperty(160, 1, data);
progress.setText("Suche Geräte");

for(var i = 0; i < 64; i++)
{
    var para = device.getParameterByName("ballast" + i);
    para.value = "";
}

var counter = 0;

while(true)
{
    if(progress.isCanceled())
    {
        //get State with max devicecount so device will stop and delete variables
        online.readFunctionProperty(160, 1, [7, 254]);
        return;
    }

    var resp = online.readFunctionProperty(160, 1, [3]);
    if(resp[0]) break;
    progress.setText(resp[1] + " Geräte gefunden");

    //just skip some time so we dont overkill the 
    //~2s depends on device
    var start = new Date();
    var count = 0;
    var millis = 3000;
    // busy waiting, as there is no other known possibility in ETS
    while (new Date() - start < millis) {
        count++;
    }
}

while(true)
{
    if(progress.isCanceled())
    {
        //get State with max devicecount so device will stop and delete variables
        online.readFunctionProperty(160, 1, [7, 254]);
        return;
    }

    var resp = online.readFunctionProperty(160, 1, [7, counter]);

    if(resp[0])
    {
        //found ballast
        var high = "";
        if(resp[1] < 16) high = "0";
        high += resp[1].toString(16);
        if(resp[2] < 16) high += "0";
        high += resp[2].toString(16);
        if(resp[3] < 16) high += "0";
        high += resp[3].toString(16);
        var para = device.getParameterByName("ballast" + counter);
        high = "0x" + high;
        if(resp[4] < 99)
            high += " -> " + resp[4];
        para.value = high;
        counter++;
    } else {
        break;
    }
}

progress.setText(counter + " Geräte gefunden");
}
